text:
i’m now happily in nyc, but what did i pack onboard??? .
here goes...
.
@formnutrition advanced nootropic complex. this company had me “zzzzs” printed on their bottle, but then i read it housed 5-htp, l-theanine, magnesium which = legit sleep support!
.
@herbpharm rapid immune boost. also not pictured: their adrenal support and sore throat spray – my favs every time i fly.
.
@trinnylondon glinda lip to cheek to help me maintain a glittery, magical shine!
.
@supherbals 1700mg cbd oil. love in a bottle. not a drug, great deep sleep (for me).
.
palo santo to cleanse the air of the apartment i’m renting in nyc. scientifically-speaking this lil’ piece of sacred wood will help cleanse the air of any weird particle matter that can mess with my health. woo-woo-speaking, it’ll help shift any left-over negative vibes.
.
@aveda ‘mihana’ hair mist that keeps my hair looking, and smelling fresh when i’m busy doing all the things. perfect post plane travel when i have to hit the ground sprinting (translation: when i can’t wash my hair straight after a flight).
.
my girl katie brockhurst aka @katiekdot_socialmediaangel latest book housing authentic heart-centred strategies a must if you’re a part of this new age of sharing (and caring!).
.
@cocokind rose water facial spray. a staple.
.
bbb luscious lash oil. a must-have to give some love to my lashes.
.
@seed probiotic – i’m obsessed with this little travel bottle!
.
@mauli tension release dome. check out my post @crazysexykris to learn more about this wonderous ayurvedic facial tool.
.
a new chocolate cookie creation of mine that supports the body (particularly your nervous system) in all the ways (obvi!). recipe coming soon x

